import { createRouter, createWebHistory } from 'vue-router'
import Login from '../views/Login.vue'
import Register from '../views/Register.vue'
import Dashboard from '../views/Dashboard.vue'
import UserManage from '../views/UserManage.vue'
import Profile from '../views/Profile.vue'
import SystemSettings from '../views/SystemSettings.vue'
import RoleManage from '../views/RoleManage.vue'
import OperationLog from '../views/OperationLog.vue'
import LoginLog from '../views/LoginLog.vue'
import SupplierManage from '../views/SupplierManage.vue'
import CustomerManage from '../views/CustomerManage.vue'

const routes = [
  {
    path: '/',
    redirect: '/login'
  },
  {
    path: '/login',
    name: 'Login',
    component: Login
  },
  {
    path: '/register',
    name: 'Register',
    component: Register
  },
  {
    path: '/dashboard',
    name: 'Dashboard',
    component: Dashboard,
    children: [
      {
        path: 'users',
        name: 'UserManage',
        component: UserManage
      },
      {
        path: 'roles',
        name: 'RoleManage',
        component: RoleManage
      },
      {
        path: 'profile',
        name: 'Profile',
        component: Profile
      },
      {
        path: 'settings',
        name: 'SystemSettings',
        component: SystemSettings
      },
      {
        path: 'operation-log',
        name: 'OperationLog',
        component: OperationLog
      },
      {
        path: 'login-log',
        name: 'LoginLog',
        component: LoginLog
      },
      {
        path: 'suppliers',
        name: 'SupplierManage',
        component: SupplierManage
      },
      {
        path: 'customers',
        name: 'CustomerManage',
        component: CustomerManage
      },
      {
        path: 'basic',
        name: 'Basic',
        component: () => import('@/views/basic/index.vue'),
        meta: { title: '基础数据', icon: 'DataLine' },
        children: [
          {
            path: 'dealers',
            name: 'Dealers',
            component: () => import('@/views/basic/dealer/index.vue'),
            meta: { title: '经销商管理' }
          },
          {
            path: 'retailers',
            name: 'Retailers',
            component: () => import('@/views/basic/retailer/index.vue'),
            meta: { title: '零售商管理' }
          },
          {
            path: 'supplier',
            component: SupplierManage,
            meta: { title: '供应商管理' }
          },
          {
            path: 'customer',
            component: CustomerManage,
            meta: { title: '客户管理' }
          },
          {
            path: 'purchaser',
            component: () => import('@/views/basic/purchaser/index.vue'),
            meta: { title: '采购员管理' }
          }
        ]
      },
      {
        path: 'product',
        name: 'Product',
        component: () => import('@/views/product/index.vue'),
        meta: { title: '商品管理', icon: 'Goods' },
        children: [
          {
            path: 'info',
            name: 'ProductInfo',
            component: () => import('@/views/product/info/index.vue'),
            meta: { title: '商品信息' }
          },
          {
            path: 'info/form',
            name: 'ProductForm',
            component: () => import('@/views/product/info/form.vue'),
            meta: { title: '商品表单' }
          },
          {
            path: 'info/detail',
            name: 'ProductDetail',
            component: () => import('@/views/product/info/detail.vue'),
            meta: { title: '商品详情' }
          },
          {
            path: 'category',
            name: 'ProductCategory',
            component: () => import('@/views/product/category/index.vue'),
            meta: { title: '分类管理' }
          },
          {
            path: 'pricing',
            name: 'ProductPricing',
            component: () => import('@/views/product/pricing/index.vue'),
            meta: { title: '定价管理' }
          }
        ]
      },
      {
        path: 'purchase',
        name: 'Purchase',
        component: () => import('@/views/purchase/index.vue'),
        meta: { title: '采购管理', icon: 'ShoppingCart' },
        children: [
          {
            path: 'requisition',
            name: 'PurchaseRequisition',
            component: () => import('@/views/purchase/requisition/index.vue'),
            meta: { title: '采购申请' }
          },
          {
            path: 'requisition/form',
            name: 'PurchaseRequisitionForm',
            component: () => import('@/views/purchase/requisition/form.vue'),
            meta: { title: '采购申请表单' }
          },
          {
            path: 'order',
            name: 'PurchaseOrder',
            component: () => import('@/views/purchase/order/index.vue'),
            meta: { title: '采购订单' }
          },
          {
            path: 'order/form',
            name: 'PurchaseOrderForm',
            component: () => import('@/views/purchase/order/form.vue'),
            meta: { title: '采购订单表单' }
          },
          {
            path: 'inbound',
            name: 'PurchaseInbound',
            component: () => import('@/views/purchase/inbound/index.vue'),
            meta: { title: '采购入库' }
          },
          {
            path: 'inbound/form',
            name: 'PurchaseInboundForm',
            component: () => import('@/views/purchase/inbound/form.vue'),
            meta: { title: '采购入库表单' }
          }
        ]
      },
      {
        path: 'purchase/inbound',
        component: () => import('@/views/purchase/inbound/index.vue'),
        name: 'PurchaseInbound',
        meta: { title: '采购入库', icon: 'el-icon-box' }
      },
      {
        path: 'warehouse',
        name: 'Warehouse',
        meta: { title: '仓库管理', icon: 'el-icon-house' },
        children: [
          {
            path: 'info',
            component: () => import('@/views/warehouse/info/index.vue'),
            name: 'WarehouseInfo',
            meta: { title: '仓库信息', icon: 'el-icon-office-building' }
          },
          {
            path: 'stock',
            component: () => import('@/views/warehouse/stock/index.vue'),
            name: 'WarehouseStock',
            meta: { title: '库存管理', icon: 'el-icon-box' }
          }
        ]
      }
    ]
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
